function get_city_by_phone(phone) {
    var phoneUtil = i18n.phonenumbers.PhoneNumberUtil.getInstance();
    var p = phoneUtil.parse("+" + phone.replace(/[^\d]/g, ''));
    if (p.getCountryCode() == 7) {
        var code5 = p.getNationalNumber().toString().slice(0, 5);
        var code4 = p.getNationalNumber().toString().slice(0, 4);
        var code3 = p.getNationalNumber().toString().slice(0, 3);
        for (i in CITY_CODES['ru']) {
            var el = CITY_CODES['ru'][i];
            if (el.code && el.code.indexOf(code5) == 0
                || el.code && el.code.indexOf(code5) > 3
                || el.code && el.code.indexOf(code4) == 0
                || el.code && el.code.indexOf(code4) > 3
                || el.code && el.code.indexOf(code3) == 0
                || el.code && el.code.indexOf(code3) > 3
                ) {
                return _.clone(el);
            } else continue;
        }
    }
    return false;
}